import React,{Component} from 'react';
import '../App.css';

class Voting extends Component{
	languages = [{language: "Python", votes: 0}]



	render(){
		return(
			<div>
                <ul>
                    <li>{this.languages[0].language}</li>
                </ul>
            </div>
		);
	}
}
export default Voting;
